BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "data_cpu" (
	"name"	TEXT,
	"rating"	INTEGER,
	"rating_count"	INTEGER,
	"price_usd"	TEXT,
	"core_count"	INTEGER,
	"core_clock"	TEXT,
	"boost_clock"	TEXT,
	"tdp"	TEXT,
	"integrated_graphics"	TEXT,
	"smt"	TEXT
);
CREATE TABLE IF NOT EXISTS "data_gpu" (
	"name"	TEXT,
	"rating"	INTEGER,
	"rating_count"	INTEGER,
	"price_usd"	TEXT,
	"chipset"	TEXT,
	"memory"	TEXT,
	"core_clock"	TEXT,
	"boost_clock"	TEXT,
	"color"	TEXT,
	"length"	TEXT
);
CREATE TABLE IF NOT EXISTS "data_memory" (
	"name"	TEXT,
	"rating"	INTEGER,
	"rating_count"	INTEGER,
	"price_usd"	TEXT,
	"speed"	TEXT,
	"modules"	TEXT,
	"price_/_gb"	TEXT,
	"color"	TEXT,
	"first_word_latency"	TEXT,
	"cas_latency"	INTEGER
);
CREATE TABLE IF NOT EXISTS "data_storage" (
	"name"	TEXT,
	"rating"	INTEGER,
	"rating_count"	INTEGER,
	"price_usd"	REAL,
	"capacity"	TEXT,
	"price_/_gb"	TEXT,
	"type"	TEXT,
	"cache"	TEXT,
	"form_factor"	TEXT,
	"interface"	TEXT
